import React, { useState, useEffect } from 'react';

const Friends = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        // Fetch user details from MongoDB API endpoint
        const fetchUsers = async () => {
            try {
                const response = await fetch('http://localhost:5000/api/auth/getuser'); // replace with your API endpoint
                const data = await response.json();
                setUsers(data);
            } catch (error) {
                console.error('Failed to fetch users:', error);
            }
        };

        fetchUsers();
    }, []);

    return (
        <div>
            <h1>User List</h1>
            <ul>
                {users.map(user => (
                    <li key={user._id}>
                        <strong>Name:</strong> {user.name}, <strong>Email:</strong> {user.email}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Friends;
